CREATE TABLE `ContestProblem` (
  `problemId` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(50) NOT NULL,
  `source` varchar(200) DEFAULT NULL,
  `author` varchar(100) DEFAULT NULL,
  `docType` varchar(20) NOT NULL,
  `timeLimit` int(11) NOT NULL COMMENT '单位：s',
  `timeLimitSpc` int(11) NOT NULL DEFAULT '0',
  `memoryLimit` int(11) NOT NULL COMMENT '单位：M',
  `submits` int(11) NOT NULL DEFAULT '0' COMMENT '总提交数',
  `accepts` int(11) NOT NULL DEFAULT '0' COMMENT '通过数',
  `isSpj` tinyint(1) NOT NULL DEFAULT '0',
  `addTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `judgeFiles` int(11) NOT NULL,
  `isShow` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`problemId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='比赛题目表';
