  `judgeTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `judgeType` smallint(6) NOT NULL COMMENT '判题类型：0/ACM标准 1/OI标准 2/测试',
  `codeLength` int(11) NOT NULL COMMENT '代码长度，单位：B',
  `lang` smallint(6) NOT NULL,
  `problemId` int(11) DEFAULT NULL,
  `userId` int(11) NOT NULL,
  `contestId` int(11) DEFAULT NULL,
  `maxMemory` int(11) DEFAULT NULL COMMENT '单位：M',
  `maxTime` int(11) DEFAULT NULL COMMENT '单位：ms',
  `sumTime` int(11) DEFAULT NULL COMMENT '判题总时间，单位：ms',
  `sumCases` int(11) NOT NULL COMMENT '总case数',
  `passCases` int(11) DEFAULT NULL,
  `detailCases` varchar(200) DEFAULT NULL COMMENT '返回的详细通过情况',
  PRIMARY KEY (`solutionId`),
  KEY `problemId` (`problemId`),
  KEY `userId` (`userId`),
  KEY `contestId` (`contestId`)
) ENGINE=InnoDB AUTO_INCREMENT=135 DEFAULT CHARSET=utf8 COMMENT='代码提交表';
